import React, { Component } from 'react';
import './App.css';
import Chart from 'react-apexcharts';

class App extends Component {
  constructor(props) {
    this.state = {
      options: {
        chart: {
          id: "basic-bar"
        },
        xaxis: {
          categories: [1991, 1992, 1993, 1994, 1995, 1996, 1997, 1998, 1999]
        }
      },
      series: [
        {
          name: "series-1",
          data: [30, 40, 45, 50, 49, 60, 70, 91]
        }
      ]
    }
  }

  render() {
    return (
      <div className="App">
      </div>
    );
  }
}

export default App;
